// SPDX-License-Identifier: SEE LICENSE IN LICENSE
pragma solidity 0.8.24;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/interfaces/IERC20.sol";
import "./IWrappedTokenGatewayV3.sol";

/**
 * @title VaultKDO
 * @author Michael Orts
 * @notice VaultKDO allows to deposit and withdraw pool funds on DeFi platform.
 */
contract VaultKDO is Ownable {

    IWrappedTokenGatewayV3 private immutable wtgV3;//0x387d311e47e80b498169e6fb51d3193167d89F7D 
    IERC20 private immutable erc20Token;//0x5b071b590a59395fE4025A0Ccc1FcC931AAc1830 

    mapping (uint256 => uint256) private poolBalances;

    event DepositDone(uint256 index, uint256 amount);
    event WithdrawDone(uint256 index, uint256 amount);

    /**
     * Creates VaultKDO as owner with implementations of AAVE contracts needed.
     * 
     * @param _wtgV3 AAVE gateway contract
     * @param _erc20Token ERC20 token
     */
    constructor(IWrappedTokenGatewayV3 _wtgV3, IERC20 _erc20Token) Ownable(msg.sender) {
        wtgV3 = _wtgV3;
        erc20Token = _erc20Token;
    }

    receive() external payable {}

    /**
     * Deposits funds on Aave platform and updates pool balance if owner.
     * 
     * @param index pool index
     */
    function deposit(uint256 index) external payable onlyOwner {
        emit DepositDone(index, msg.value);
        poolBalances[index] += msg.value;
        wtgV3.depositETH{value: msg.value}(address(0x6Ae43d3271ff6888e7Fc43Fd7321a503ff738951),address(this),0);
    }

    /**
     * Withdraws funds on pool, and send it to sender if owner.
     * 
     * @param index pool index to withdraw
     */
    function withdraw(uint256 index) external onlyOwner {
        emit WithdrawDone(index, poolBalances[index]);
        require(erc20Token.approve(address(wtgV3), poolBalances[index]), "approve failed");
        wtgV3.withdrawETH(address(0x6Ae43d3271ff6888e7Fc43Fd7321a503ff738951), poolBalances[index], address(this));
        (bool sent,) = msg.sender.call{value: address(this).balance}("");
        require(sent, "Failed to withdraw Ether");
    }

    /**
     * Returns all supply deposited if owner.
     */
    function getSupply() external view onlyOwner returns (uint256) {
        return erc20Token.balanceOf(address(this));
    }

}

